/*Table structure for table `cms_article` */

DROP TABLE IF EXISTS `cms_article`;

CREATE TABLE `cms_article` (
  `id` int(11) NOT NULL auto_increment COMMENT '文章ID',
  `cid` int(11) NOT NULL COMMENT '所属栏目ID',
  `title` varchar(200) NOT NULL COMMENT '标题',
  `subtitle` varchar(200) default NULL,
  `att` set('a','b','c','d','e','f','g') default NULL COMMENT '属性',
  `pic` varchar(200) default NULL COMMENT '缩略图',
  `pic_info` varchar(500) default NULL,
  `pic02` varchar(500) default NULL,
  `pic02_info` varchar(500) default NULL,
  `pic03` varchar(500) default NULL,
  `pic03_info` varchar(500) default NULL,
  `source` text COMMENT '来源',
  `author` text COMMENT '作者',
  `resume` varchar(500) default NULL COMMENT '摘要',
  `pubdate` varchar(40) NOT NULL COMMENT '发表日期',
  `content` text COMMENT '文章内容',
  `hits` int(11) NOT NULL default '0' COMMENT '点击次数',
  `orderlist` int(11) NOT NULL default '0',
  `created_by` int(11) NOT NULL COMMENT '创建者',
  `created_date` datetime NOT NULL COMMENT '创建时间',
  `delete_session_id` int(11) default NULL COMMENT '删除人ID',
  PRIMARY KEY  (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=31 DEFAULT CHARSET=utf8;

/*Data for the table `cms_article` */

/*Table structure for table `cms_baby` */

DROP TABLE IF EXISTS `cms_baby`;

CREATE TABLE `cms_baby` (
  `id` int(11) NOT NULL auto_increment COMMENT '文章ID',
  `cid` varbinary(50) NOT NULL COMMENT '学籍号',
  `title` varchar(200) default NULL COMMENT '姓名',
  `classroom` varchar(50) default NULL COMMENT '年级',
  `sex` varchar(10) default NULL COMMENT '性别',
  `faceimg` varchar(500) default NULL COMMENT '头像',
  `birth` varchar(100) default NULL COMMENT '出生年月日',
  `openid` varchar(100) default NULL,
  `mobile` varchar(100) default NULL COMMENT '联系方式',
  `address` varchar(200) NOT NULL COMMENT '家庭住址',
  `created_by` int(11) NOT NULL COMMENT '创建者',
  `created_date` datetime NOT NULL COMMENT '创建时间',
  `delete_session_id` int(11) default NULL COMMENT '删除人ID',
  PRIMARY KEY  (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=863 DEFAULT CHARSET=utf8;

