/*Table structure for table `cms_cart` */

DROP TABLE IF EXISTS `cms_cart`;

CREATE TABLE `cms_cart` (
  `id` int(11) NOT NULL auto_increment COMMENT 'ID',
  `ordernum` varchar(255) NOT NULL,
  `productid` int(11) NOT NULL,
  `title` varchar(255) NOT NULL,
  `pic` varchar(255) NOT NULL,
  `price` varchar(255) NOT NULL,
  `num` varchar(255) NOT NULL,
  `userid` int(11) NOT NULL,
  PRIMARY KEY  (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

/*Data for the table `cms_cart` */

/*Table structure for table `cms_case` */

DROP TABLE IF EXISTS `cms_case`;

CREATE TABLE `cms_case` (
  `id` int(11) NOT NULL auto_increment COMMENT '文章ID',
  `cid` int(11) NOT NULL COMMENT '所属栏目ID',
  `title` varchar(200) NOT NULL COMMENT '标题',
  `subtitle` varchar(200) default NULL,
  `att` varchar(255) default NULL COMMENT '属性',
  `pic` varchar(200) default NULL COMMENT '缩略图',
  `pic_big` varchar(200) default NULL,
  `price` varchar(200) default '0' COMMENT '来源',
  `brand` varchar(300) default NULL COMMENT '作者',
  `resume` varchar(500) default NULL COMMENT '摘要',
  `purpose` text,
  `subsidiary` text,
  `pubdate` varchar(40) NOT NULL COMMENT '发表日期',
